            var nSec = estTime.getSeconds() >= 10 ? estTime.getSeconds() : "0" + estTime.getSeconds();
            var strDate = mYear + "/" + mMonth + "/" + mDay + "  " + nHour + ":" + nMin + ":" + nSec + " EST";
            return strDate;
