        BetComponent.prototype.formatNumber = function (number, digit) {
            var step = 10;
            var strPrefix = "";
            for (var i = 1; i < digit; i++) {
                strPrefix += "0";
            }
            var strNumber = number + '';
            for (var i = 1; i < digit; i++) {
                if (number < step) {
                    strNumber = strPrefix + number;
                    break;
                } else {
                    strPrefix = strPrefix.substring(1);
                    step *= 10;
                }
            }
            return strNumber;
        };
